","keccak256":"0x6e6e4b0835904509406b070ee173b5bc8f677c19421b76be38aea3b1b3d30846","license":"MIT"},"contracts/DiamondInit.sol":{"content":"// SPDX-License-Identifier: No-License
pragma solidity 0.8.17;

import "./libraries/LibFacet.sol";
import "hardhat/console.sol";

contract DiamondInit {
    function ethToERCInit(
        address[] memory _tokenPools,
        string[] memory _tokenSymbols,
        address _priceFeed,
        uint256 _feeDivisor,
        uint256 _precisionMult
    ) public {
        LibFacet.FacetStorage storage fs;
        bytes32 position = LibFacet.FACET_STORAGE_POSITION;
        assembly {
            fs.slot := position
        }

        fs.precisionMult = 10**_precisionMult;
        fs.feeDivisor = (10**18 * 100) / _feeDivisor;
        fs.priceFeed = PriceFeed(_priceFeed);
        for (uint256 i = 0; i < _tokenPools.length; i += 2) {
            address token1Contract = _tokenPools[i];
            address token2Contract = _tokenPools[i + 1];
            string memory pair = string.concat(
                _tokenSymbols[i],
                "/",
                _tokenSymbols[i + 1]
            );

            fs.pools.push(pair);

            fs.tokenPools[pair] = LibFacet.PairPool(
                _tokenSymbols[i],
                _tokenSymbols[i + 1],
                token1Contract,
                token2Contract,
                0,
                0,
                0,
                0,
                0,
                0,
                true
            );
        }
    }
}
","keccak256":"0xe29e25a87aa210098b92f2b9c1f4fff5ce9434a4b9eea7cae3c2b300c29d3495","license":"No-License"},"contracts/PriceFeed.sol":{"content":"// SPDX-License-Identifier: no-license
pragma solidity 0.8.17;
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV2V3Interface.sol";

contract PriceFeed {
    mapping(address => AggregatorV3Interface) priceFeeds;

    constructor(
        address[] memory _tokenContracts,
        address[] memory _tokenAggregators
    ) {
        require(
            _tokenContracts.length == _tokenAggregators.length,
            "Mismatch in amount of token contracts and token aggregators."
        );

        for (uint256 i = 0; i < _tokenContracts.length; i++) {
            address tokenContract = _tokenContracts[i];
            address tokenAggregator = _tokenAggregators[i];
            priceFeeds[tokenContract] = AggregatorV3Interface(tokenAggregator);
        }
    }

    function getPrice(address _tokenContract) public view returns (uint256) {
        (, int256 price, , , ) = priceFeeds[_tokenContract].latestRoundData();
        return uint256(price);
    }
}
","keccak256":"0x4a9b267370e8fce7a2ed2100c2e428ace45d7f708a2f9e3d775ae3077e5feabe","license":"no-license"},"contracts/libraries/LibFacet.sol":{"content":"// SPDX-License-Identifier: No-License
pragma solidity 0.8.17;

import "../PriceFeed.sol";

library LibFacet {
    bytes32 constant FACET_STORAGE_POSITION =
        keccak256("diamond.standart.facet.storage");

    struct LiquidityShare {
        uint256 t1Amount;
        uint256 t2Amount;
    }

    struct PairPool {
        string token1;
        string token2;
        address token1Con;
        address token2Con;
        uint256 token1Amount;
        uint256 token2Amount;
        uint256 token1Seed;
        uint256 token2Seed;
        uint256 t1Fees;
        uint256 t2Fees;
        bool created;
    }

    struct FacetStorage {
        PriceFeed priceFeed;
        mapping(string => PairPool) tokenPools;
        mapping(string => mapping(address => LiquidityShare)) liquidityShares;
        mapping(string => address[]) liquidityProviders;
        string[] pools;
        uint256 feeDivisor;
        uint256 precisionMult;
        LiquidityShare share;
        PairPool pool;
    }

    function facetStorage() internal pure returns (FacetStorage storage fs) {
        bytes32 position = FACET_STORAGE_POSITION;
        assembly {
            fs.slot := position
        }
    }
}
